DECLARE @i int SET @i = 1
  WHILE (@i <= (SELECT MAX(id) FROM OrderInfo))
	BEGIN
	UPDATE OrderInfo SET ChannelId = (
	SELECT rst
	FROM (
		SELECT 0 AS id, 1 as rst
		UNION ALL
		SELECT 1, 2
		UNION ALL
		SELECT 2, 3 )
		x WHERE id = FLOOR (rand()*3))
		WHERE Id = @i
		SET @i = @i + 1
    END;